var act = 0;

var reset_graph = (op, class_pad, padre,datos) => {
  let button = document.createElement('div');
  button.classList.add('btn');
  button.classList.add('btn-border');
  button.classList.add('btn-clean');
  button.classList.add('pull-right');

  let icon = document.createElement('i');
  icon.classList.add('fa');
  icon.classList.add('fa-trash');
  let span = document.createElement('span');
  span.innerText = ' Borrar';

  button.appendChild(icon);
  button.appendChild(span);

  let removeBarChartOpacityMtt = (() => {
    let bars = svg.selectAll('g.bar-chart-group').selectAll('g').selectAll('rect')
    bars.style('opacity', function(d){
      return 1
    })
    svg.select('.x.axis').selectAll('text').transition().duration(500)
    .style('opacity', function(d){
      return 1
    });

  });

  let removeDonutsOpacityMtt = (() => {
    let bars = svg.select('g.donut-chart-group').selectAll('.donut-arc');
    bars.transition().duration(500).style('opacity', function(d){
      return 1
    });
    svg.select('g.labels-group').transition().duration(500).selectAll('.labels')
    .style('opacity', function(d){
      return 1
    });
  });

  let removeFilter = (() => {
    if (op == 1){
        d3.selectAll("#link_1").attr("class","link");
        d3.selectAll("#link_2").attr("class","link");
        d3.selectAll("#link_3").attr("class","link");
        d3.selectAll("#link_4").attr("class","link");
        padre.data([datos[0].set_general.Ingresadas,datos[0].set_general.Retiradas]);
        padre.dataTitle("Total Flujo Movilizado en Terminales Regionales")

        if (act == 1) d3.select("#Contenedorizada5").style("fill","#3182bd");
        if (act == 2) d3.select("#Fraccionada4").style("fill","#3182bd");
        if (act == 3) d3.select("#Granel2").style("fill","#3182bd");
        if (act == 4) d3.select("#Granel3").style("fill","#3182bd");
        act = 0;
    }
    if (op == 2){
        general();
    }
    if (op == 3){
        svg = d3.select("#barras_almacenes").select('svg');
        removeBarChartOpacityMtt();
        padre.data([datos[0].general.despachado ,datos[0].general.ingresado]);
    }
    if (op == 4){
        general2();
    }
  })
  button.addEventListener('click', removeFilter )
  document.getElementsByClassName(class_pad)[0].insertBefore(button, document.getElementsByClassName(class_pad)[0].firstChild);
}

var button_personas = (op,tipo,tipo_trabajador,class_padre) =>{
    let button = document.createElement('div');
    button.classList.add('btn');
    button.classList.add('btn-border');
    button.classList.add('btn-clean');
    button.classList.add('pull-right');

    let icon = document.createElement('i');
    icon.classList.add('fa');
    icon.classList.add('fa-graduation-cap');
    let span = document.createElement('span');

    span.innerText = tipo_trabajador;
    if ($(window).width() < 768){
      span.innerText = '';
    }

    let Filtro = (() => {
        if(op == 1){
            if(tipo == 1) profesional();
            if(tipo == 2) tecnico();
            if(tipo == 3) otros();
        }else{
            if(tipo == 1) profesional2();
            if(tipo == 2) tecnico2();
            if(tipo == 3) otros2();
        }
    })

    button.appendChild(icon);
    button.appendChild(span);
    button.addEventListener('click', Filtro )
    document.getElementsByClassName(class_padre)[0].insertBefore(button, document.getElementsByClassName(class_padre)[0].firstChild);
}

