function mapa_valparaiso(){

    let labelTip = '<span>Cantidad de empresas: </span>';
    let tip = d3.tip()
                .attr('class', 'd3-tip-bar')
                .style('z-index', '99')
                .html(function(d,val,porcentaje) {
                return "<strong>"+d+"<br></strong>"+ labelTip +"<span>"+d3.round(val,0).toLocaleString()+" </span>" + "<span> <br>"+porcentaje+"% de 529 empresas</span>";
                });

    width = 575;
    height = 500;

    let projection = d3.geo.mercator()
          .translate([width*18*1.254,-width*18*0.59])
          .scale(width*18);

    let path = d3.geo.path().projection(projection);

    let svg = d3.select("#mapa_valparaiso").append("svg")
                .attr("width", width)
                .attr("height", height);

    svg.append("rect")
          .attr('x' ,390)
          .attr('y', 20)
          .attr("height",305)
          .attr("width",170)
          .style("fill", "DFDFDF")
          .style("stroke","#AAACAF")
          .style("stroke-width",4)
          .style("fill-opacity",0.4)
          ;
    svg.append("text")
        .attr("x",403)
        .attr("y",42)
        .text("Provincia de Valparaíso")
        .attr("fill","#6C6C6C");


    let features = valparaiso.features;

    svg.append("g")
            .selectAll("path")
            .data(features)
            .enter().append("path")
            .attr("d", path)
            .style('fill', 'none')
            .on('mouseover', function(d,i){
                let name = d.properties.NOM_PROV;
                //Prov Aconcagau
                if (name == "San Felipe") tip.show("Provincia de Aconcagua", 53,10 );
                //Prov San antonio
                if (name == "San Antonio")  tip.show("Provincia de San Antonio", 132,25 );
                //Prov. Valparaiso
                if (name == "Valparaíso") tip.show( "Provincia de Valparaíso", 304 ,58);
            })
            .on('mouseout', function(d,i){
                let name = d.properties.NOM_PROV;
                //Prov Aconcagau
                if (name == "San Felipe") tip.hide("Provincia de Aconcagua", 53,10 );
                //Prov San antonio
                if (name == "San Antonio")  tip.hide("Provincia de San Antonio", 132,25 );
                //Prov. Valparaiso
                if (name == "Valparaíso") tip.hide( "Provincia de Valparaíso", 304 ,58);
            })
            .style('fill', function(d,i){

                let name = d.properties.NOM_PROV;
                //Prov Aconcagau
                if (name == "San Felipe") return "#56ACFC"
                //Prov San antonio
                if (name == "San Antonio")  return "#2E9AFE";
                //Prov. Valparaiso
                if (name == "Valparaíso") return "#146BC8";
                return '#98a3b0';
            })
            .style('stroke', '#FDFDFD')
            .style('stroke-width', '0.5')
    svg.call(tip)

    let labelTip2 = '<span>Cantidad de empresas: </span>';
    let tip2 = d3.tip()
                  .attr('class', 'd3-tip-bar')
                  .style('z-index', '99')
                  .html(function(d,val,porcentaje){
                    if (d == "Casablanca") return "<strong> Comuna de Casablanca <br></strong> <span>Cantidad de empresas: 66 empresas</span><span> <br> 13% del total</span>";
                    if (d == "Placilla") return "<strong> Placilla <br></strong> <span>Cantidad de empresas: 94 empresas</span> <span> <br> 18% del Total</span>";
                  });

    let scale = 25;
    let projection2 = d3.geo.mercator()
          .translate([width*scale*1.28,-width*scale*0.599])
          .scale(width*scale);

    let path2 = d3.geo.path().projection(projection2);

    let features2 = zoom.features;

    svg.append("g")
            .selectAll("path")
            .data(features2)
            .enter().append("path")
            .attr("d", path2)
            .style('fill', 'none')
            .on('mouseover', function(d,i){
                let name = d.properties.NOMBRE;
                if (name == "Casablanca") tip2.show("Casablanca", 304,58 );
                if (name == "Placilla") tip2.show("Placilla", 304,58 );
            })
            .on('mouseout', function(d,i){
                let name = d.properties.NOMBRE;
                if (name == "Casablanca")   tip2.hide( "Casablanca", 304 );
                if (name == "Placilla") tip2.hide("Placilla", 304,58 );
            })
            .style('fill', function(d,i){
                let name = d.properties.NOMBRE;
                if (name == "Casablanca" || name  == "Placilla") return "#146BC8";
                return '#98a3b0';
            })
            .style('stroke', '#FDFDFD')
            .style('stroke-width', '0.5')
    svg.call(tip2)


}
